import axios from 'axios';

const API_URL = 'http://localhost:5000';

const ProductosService = {
  getAll: async () => {
    try {
      const res = await axios.get(`${API_URL}/productos`);
      return res.data;
    } catch (err) {
      return { productos: [] };
    }
  }
};

export default ProductosService;
